package codeup;
import java.util.Scanner;
public class codeup79 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		
		while (true) {
			String input = sc.next();
			if (input.equals("q")) {
				System.out.println(input);
				break;
			}
				System.out.println(input);
			}
		sc.close();

	}

}
